import { Link } from 'react-router-dom'
import css from './groupCard.module.css'
import {
    CircularProgressbar,
    CircularProgressbarWithChildren,
    buildStyles
  } from "react-circular-progressbar";
  import "react-circular-progressbar/dist/styles.css";

export default function GroupCard(props: any){
    return (
        <>
        <Link to={`/${props.title}`} className="block p-6 bg-white rounded-lg border border-gray-200 shadow-md hover:bg-gray-100 dark:bg-gray-800 dark:border-gray-700 dark:hover:bg-gray-700">
            <h6 className="break-words !text-sm h-16 text-center mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">{props.title_rus}</h6>
            <CircularProgressbarWithChildren
                value={75}
                strokeWidth={6}
                styles={buildStyles({
                pathColor: "#2d2",
                trailColor: "transparent"
                })}
            >
            {/*
            Width here needs to be (100 - 2 * strokeWidth)% 
            in order to fit exactly inside the outer progressbar.
            */}
            <div style={{ width: "84%" }}>
                <CircularProgressbar
                    value={70}
                    styles={buildStyles({
                    trailColor: "transparent"
                    })}
                />
            </div>
        </CircularProgressbarWithChildren>
        </Link>

        </>

    )
}
